import Link from 'next/link';

const Index = () => (

<div className = "Index">

    <h1>Home</h1>

    <ul>
        <li><Link href='/'><a>Home</a></Link></li>
        <li><Link href='/about'><a>About</a></Link></li>

    </ul>
    <h1>Hello World, this is your project tracker</h1>



</div>



);

export default Index;
